import React, { Component } from "react";
import Button from 'react-bootstrap/Button';

export default class TimeAdder extends Component {
    constructor(props) {
        super(props);

        this.state = {
            isPressed: false
        }
    }

    isPressed = () => {
        this.setState({
            isPressed: !this.state.isPressed
        })
        this.props.addTime(this.props.time)
        console.log(this.state.isPressed)
    }

    render() {
        return (

            <div>
                <Button variant="dark" onClick={() => this.isPressed()} >Add to Time Counter</Button>
            </div >
        )
    }
}
